import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { CssBaseline, ThemeProvider, createTheme } from '@mui/material';
import { BrowserRouter } from 'react-router-dom';
import './styles/global.css';

const theme = createTheme({
  palette: {
    mode: 'light',
    primary: {
      main: '#FBD437',
      contrastText: '#023C4F'
    },
    secondary: {
      main: '#023C4F',
      contrastText: '#fff'
    },
    background: {
      default: '#F8F9FA',
      paper: '#fff'
    },
    text: {
      primary: '#023C4F',
      secondary: '#6B7280'
    }
  },
  typography: {
    fontFamily: '"Inter", "Roboto", "Helvetica", "Arial", sans-serif',
    h1: { fontWeight: 800, letterSpacing: '-0.025em' },
    h2: { fontWeight: 800, letterSpacing: '-0.025em' },
    h3: { fontWeight: 700, letterSpacing: '-0.025em' },
    h4: { fontWeight: 700, letterSpacing: '-0.025em' },
    h5: { fontWeight: 600, letterSpacing: '-0.025em' },
    h6: { fontWeight: 600, letterSpacing: '-0.025em' },
    button: { fontWeight: 700, textTransform: 'none', letterSpacing: '-0.025em' }
  },
  shape: {
    borderRadius: 14
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          borderRadius: 14,
          textTransform: 'none',
          fontWeight: 700,
          boxShadow: 'none',
          fontSize: 17
        },
        contained: {
          backgroundColor: '#FBD437',
          color: '#023C4F',
          '&:hover': {
            backgroundColor: '#e6b800',
            color: '#023C4F'
          }
        },
        outlined: {
          borderColor: '#FBD437',
          color: '#023C4F',
          '&:hover': {
            backgroundColor: '#FFFBEA',
            borderColor: '#e6b800',
            color: '#023C4F'
          }
        }
      }
    },
    MuiCard: {
      styleOverrides: {
        root: {
          background: '#fff',
          border: '1.5px solid #FBD437',
          boxShadow: '0 4px 24px 0 rgba(2,60,79,0.06)',
          color: '#023C4F',
          borderRadius: 18
        }
      }
    },
    MuiTextField: {
      styleOverrides: {
        root: {
          '& .MuiOutlinedInput-root': {
            borderRadius: 12,
            background: '#fff',
            color: '#023C4F',
            '& fieldset': {
              borderColor: '#FBD437'
            },
            '&:hover fieldset': {
              borderColor: '#023C4F'
            },
            '&.Mui-focused fieldset': {
              borderColor: '#FBD437'
            }
          }
        }
      }
    }
  }
});

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <App />
      </ThemeProvider>
    </BrowserRouter>
  </React.StrictMode>
);
